import React, {Component} from 'react';
import logo from './logo.svg';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import {Container, Row, Col, Navbar,Image} from 'react-bootstrap';
import Home from './Components/Home/Home';
import WAW from './Components/WAW/WAW';
import Works from './Components/Works/Works';
import Exhib from './Components/Exhib/Exhib';
import Contact from './Components/Contact/Contact';

function App() {
    return (
        <Router>
            <Navbar className='color-nav' fixed='top' align="center">
                <Col><Navbar.Brand href="#home">
                    <img
                        src={require('./bkflogonew.png')}
                        width="30"
                        height="30"
                        className="d-inline-block align-top"
                        alt="BREAKFAST"
                        />
                    </Navbar.Brand></Col>
                <Col><Link to={'/who_are_we'} className="nav-link"> WHO ARE WE </Link></Col>
                <Col><Link to={'/works'} className="nav-link">WORKS</Link></Col>
                <Col><Link to={'/exhib'} className="nav-link">EXHIBITIONS</Link></Col>
                <Col><Link to={'/contact'} className="nav-link">CONTACTS</Link></Col>
                <Col><Link to={'/'} className="nav-link">INSTAGRAM</Link></Col>
            </Navbar>




            <Switch>
                <Route exact path='/' component={Home} />
                <Route path='/who_are_we' component={WAW} />
                <Route path='/works' component={Works} />
                <Route path='/exhib' component={Exhib} />
                <Route path='/contact' component={Contact} />

            </Switch>

        </Router>
    );
}

export default App;
